// src/components/LoginPage.js
import React from 'react';

export default function LoginPage() {
  return (
    <div>
      <div>
        <h1>Login</h1>
        <form>
          <input type="email" placeholder="your@email.com" />
          <input type="password" placeholder="password" />
          <div>Dont</div>
        </form>
      </div>
    </div>
  );
}
